import React from "react";

const Home = () => {
  return (
    <>
      <section id="header">
        <div className="container-fluid Nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
               <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1">
                <h1>Grow Your Business With <strong>JENA Tech</strong></h1>
                <h2>We are Team of talenter developers</h2>
               </div>    
            </div>
          </div>
        </div>
      </section>
    </>
  );
};
export default Home;
